func main()
{
  print("creating \(applicationName)")
  print("===========================")
  createAndroid()
  createScala()
  createMakefile()
}

func createMakefile()
{
  let mkf = """
  sbtPackage:
  \t cd \(applicationName).sbt; sbt package

  build: sbtPackage
  \t gradle buildDebug
    
  install: build
  \t gradle installDebug
  """
  
  FS.writeText(inString: mkf, toPath: "\(androidDir)/Makefile")
}

func createScala()
{
  let buildSBT = """
  name := "\(applicationName)"
  version := "\(appVersion)"
  scalaVersion := "\(scalaVersion)"
  """
  
  let mainApplet = """
  package \(packageName)
  import processing.core._
  import processing.core.PConstants._

  class MainApplet extends PApplet
  {
    override def settings(): Unit =
    {
      fullScreen()
    }

    override def draw(): Unit =
    {
      fill(0, 255, 0)
      ellipse(0, 0, width, height)
    }

    override def onPause(): Unit = {}
    override def onResume(): Unit = {}
  }
  
  """
  
  let scalaCodePath = "\(applicationName)/\(applicationName).sbt"
  
  mkdir("\(scalaCodePath)/src/main/scala/\(packagePath)")
  mkdir("\(scalaCodePath)/lib")
  FS.writeText(inString: buildSBT,
               toPath: "\(scalaCodePath)/build.sbt")
  FS.writeText(inString: mainApplet,
                 toPath: "\(scalaCodePath)/src/main/scala/\(packagePath)/MainApplet.scala")
  
  symbolicLink(processingModeCorePath, "\(scalaCodePath)/lib/processing-core.jar")
  symbolicLink(androidJAR, "\(scalaCodePath)/lib/android.jar")
  symbolicLink("../../\(applicationName).sbt/target/scala-\(scalaMajorVersion)/\(applicationName)_\(scalaMajorVersion)-\(appVersion).jar",
               "\(appLib)/\(applicationName).jar")
//  symbolicLink("/Users/psksvp/MyCode/Android/src/main/scala/psksvp/library",
//               "\(scalaCodePath)/src/main/scala/psksvp/library")
}

func createAndroid()
{
  func createDirStructure()
  {
    mkdir(appLib)
    mkdir(appSrc)
  }

  func fillDirStructure()
  {
    FS.writeText(inString: AppDirectoryFiles.buildDotGradle,
                   toPath: "\(appDir)/build.gradle")
    FS.writeText(inString: AppDirectoryFiles.proguardDashRulesDotPro,
                   toPath: "\(appDir)/proguard-rules.pro")
    FS.writeText(inString: AppDirectoryFiles.mainActivityDotJava,
                   toPath: "\(appSrc)/MainActivity.java")
    FS.writeText(inString: AppDirectoryFiles.androidManifestDotXML,
                   toPath: "\(appDir)/src/main/AndroidManifest.xml")
    
    gunzipBase64(AppDirectoryFiles.resDir, "\(appDir)/src/main/")
    FS.writeText(inString: AppDirectoryFiles.stringsDotXML,
                 toPath: "\(appRes)/values/strings.xml")
    
    symbolicLink("\(scalaLibLocation)/scala-library.jar", "\(appLib)/scala-library.jar")
    symbolicLink("\(scalaLibLocation)/scala-reflect.jar", "\(appLib)/scala-reflect.jar")
    symbolicLink(processingModeCorePath, "\(appLib)/processing-core.jar")
    
    /// gradle
    FS.writeText(inString: ProjectDirectoryFiles.buildDotGradle,
                   toPath: "\(androidDir)/build.gradle")
    FS.writeText(inString: ProjectDirectoryFiles.gradleDotProperties,
                   toPath: "\(androidDir)/gradle.properties")
//    FS.writeText(inString: ProjectDirectoryFiles.gradlew,
//                   toPath: "\(androidDir)/gradlew")
//    makeExe("\(androidDir)/gradlew")
    FS.writeText(inString: ProjectDirectoryFiles.localDotProperties,
                   toPath: "\(androidDir)/local.properties")
    FS.writeText(inString: ProjectDirectoryFiles.settingsDotGrade,
                   toPath: "\(androidDir)/settings.gradle")
    //gunzipBase64(ProjectDirectoryFiles.gradleDirZip, "\(androidDir)/")
  }
  
  createDirStructure()
  fillDirStructure()
}





func mkdir(_ path: String)
{
  print("mkdir: \(path)")
  ["/bin/mkdir", "-p", path].spawn()
}

func rm(_ path: String)
{
  ["/bin/rm", "-f" , path].spawn()
}

func makeExe(_ path:String)
{
  ["/bin/chmod", "+x", path].spawn()
}

func symbolicLink(_ actualPath: String, _ linkPath:String)
{
  print("symbolicLink: \(actualPath) --> \(linkPath)")
  ["/bin/ln", "-s", actualPath, linkPath].spawn()
}

func gunzipBase64(_ base64String:String, _ outputPath:String)
{
  ["/usr/bin/base64", "-d", "-o", "./t.tar.gz"].spawn(stdInput: base64String)
  //tar -xvf articles.tar --directory /tmp/my_articles/
  ["/usr/bin/tar", "-xvf", "./t.tar.gz", "--directory", outputPath].spawn()
  rm("./t.tar.gz")
}

extension String
{
  var base64Decode: String
  {
    ["/usr/bin/base64", "-d"].spawn(stdInput: self)!
  }
  
  var base64Encode: String
  {
    ["/usr/bin/base64"].spawn(stdInput: self)!
  }
}


